import * as React from 'react';
import { Link } from "react-router-dom";

const ShoppingList = ({btn}) => {
  return (
    <div>
    <h1>Shopping List</h1>
    <ul>
      {btn.map((product, index) => (
        <li key={index}>{product}</li>
      ))}
    </ul>
    <Link to="/">Back to Home</Link>
  </div>
  )
}

export default ShoppingList
